    2009 PAC report for three reasons.  One, in the first half of 2009, NRG had a
    $2,400 contribution for 'Friends for Harry Reid' returned to us.  We recorded
    that transaction in our 1st half report as a disbursement and the subsequent return
    of that disbursement as a receipt.  Since the candidate never cashed the check
    or reported the contribution, we have updated the report here to remove that disbursement
    and receipt.  Two, in our first half report, we identified two $500 disbursements
    to state of Maryland candidates (Derek Davis and Frank Kratovil) that we did not
    actually ever deliver to them (and subsequently voided). The third change is that,
    due to a calculation error, we underreported receipts from NRG employees by approximately
    $58.  We have corrected that in this revised submission.\n"
